import { Link } from "react-router-dom";
import BookCard from "./booksDir/BookCard";

const Books = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-6">
          <>
          <Link onClick="">
            <BookCard />
          </Link>
          </>
        </div>
      </div>
    </div>
  );
};

export default Books;
